import React, {useEffect} from 'react';

export const IndividualListings = (child, setQuery, setSearch) => {

    console.log(child.data.display_name_prefixed);
    return (
        <a href={() => {setSearch(""); setQuery(child.data.display_name_prefixed)}} 
        className="block px-4 py-2 text-base text-gray-700 hover:bg-gray-100 hover:text-gray-900" 
        role="menuitem"
        >{child.data.display_name_prefixed}</a>
    )
}

export const SearchResDropDown = ({result, setQuery, setSearch}) => {

    useEffect(() => {
    if (result.length <= 0){
        console.log("First if result");
        return(<div></div>);
    }
    else {
        return(
            <div className="py-1" role="none">
                {result.map((child, index) => {
                    return(
                    <a href="#"
                    className="block px-4 py-2 text-base text-gray-700 hover:bg-gray-100 hover:text-gray-900" 
                    role="menuitem"
                    >{child.data.display_name_prefixed}</a>
                    )
                    
                })}
            </div>
        );
    }
})
return null;
}
